import pizzaData from "./data"

export default function App() {
    return (
        <div>
            {pizzaData.map((pizza) => (
                <Pizza pizza={pizza} key={pizza.name} />
            ))}
            {/* <Pizza name="Pizza Broculli" desc="Delicious and crispy from inside" price="12" />
            <Pizza name="Chicken Pizza" desc="Delicious and crispy from inside" price="15" /> */}
        </div>
    )
}

function Pizza({ pizza }) {
    const [name, photoName, ingredients, price] = pizza;
    return <div>
        <img src={photoName} alt={name} />
        <h2>{name}</h2>
        <p>{ingredients}</p>
        <p>{price}</p>
    </div>
}
